import React from "react";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import "../styles/header.css";

const Header = () => {
  return (
    <div className="header">
        <div>
      <Typography variant="h3" gutterBottom>
        Hello! My name is
      </Typography>
      <Typography variant="h1" component="div" style={{ color: "#3f51b5" }}>
        Shyam Sunder.
      </Typography>
      <Typography variant="h5" gutterBottom>
        I'm a software engineer.
      </Typography>
      </div>
      <div></div>
      <Button
        variant="outlined"
        href="#"
        style={{ color: "#3f51b5", borderColor: "#3f51b5", borderWidth: "2px" ,marginTop:'20px', borderRadius:'20px'}}
      >
        View Portfolio
      </Button>
    </div>
  );
};

export default Header;
